import React from "react";
import "./Heading.css";

const Heading = (props) => {
    const Val=props.val;
    const click=props.Click;
    const Change=props.Change;
    

    return (
        <>
            <div class="container-fluid">
                <div className="row bg-dark">
                    <div className="col-md-1">
                        <span   className="design" > <i class="fas fa-utensils" ></i></span>
                        </div>
                        <div className="col-md-6">
                        <h1  className="text-light">Food Recipe</h1>
                    </div>
                    <div className="col-md-4">
                        <div class="input-group mb-3 ">
                            <input type="text" class="form-control" placeholder="Search Your Recepe..." aria-label="First name" value={Val} onChange={Change} />
                            <button  onClick={click} class="btn btn-outline-primary btn-primary text-dark" type="button" id="button-addon2">Search</button>
                          
                        </div>
                    </div>

                </div>
            </div>
        </>
    );
}

export default Heading;
